function App() {
  return (
    <div className="App">
      {
        <Profile
          name={user.name}
          tag={user.tag}
          location={user.location}
          avatar={user.avatar}
          followers={user.stats.followers}
          views={user.stats.views}
          likes={user.stats.likes}
        />
      }user.
    </div>
  );
}

export default App;
